                                 <p class="itg itg">This data analysis portal allows for interactive visualization of metrics that researchers might find beneficial. The charts in the following <em>Graphing</em> tab can be explored by changing parameters, and values can be seen by hovering over values in the graphs. The table below that contains current numbers and will be formatted upon release. Samples that had &gt;90 million read pairs were included. To be included in the visualization, genes had an expression of TPM &gt; 0.0001 in at least 90% of the samples, which includes 18,982 annotated genes.</p>                     
