var embed_vega=function(vgspec, vgsignals, data, element,tooltips) {
    var vgSpec = JSON.parse(JSON.stringify(vgspec));
    //console.log(element);
    //console.log(data);
    if (vgsignals != null) {
        var vgSignals = JSON.parse(JSON.stringify(vgsignals));
        for (let i in vgsignals) {
            var index = findMyIndex(vgSpec.signals, vgsignals[i].name);
            vgSpec.signals[index].value = vgsignals[i].value;
            vgSpec.signals[index].bind = vgsignals[i].bind;
        };
    }
    if (data != null) {
        vgSpec.data[findMyIndex(vgSpec.data, "mydata")].values = data;
    }
    vgSpec.config = config_vega();
    vegaEmbed(element, vgSpec,{
        renderer:'canvas',
        width:setWidth(),
        height:setHeight(),
        actions:{export:true,source:false,editor:false,scaleFactor:2},
        config: theme,
        defaultStyle: true,
        tooltip:tooltips
    }).then(function(result) {
        jQuery(window).resize(function() {
            result.view.resize().width(setWidth()).height(setHeight()).run();
        });        
    }).catch(console.error);

}
