var render_gene_wordcloud=function(vals) {
    var vgSpec = JSON.parse(itgz.decompressFromBase64(decodeURI('')));
    var newwidth = document.getElementById("itg-wordcloud-parent").offsetWidth - 10;
    if (newwidth < 205) {
        newwidth = setWidth();
    }
    var newheight = document.getElementById('firstcol').clientHeight - 15;
    vgSpec['marks'][0]['transform'][0]['size'][0] = newwidth;
    vgSpec['marks'][0]['transform'][0]['size'][1] = newheight;
    var wordcloud_view = new vega.View(vega.parse(vgSpec)).initialize('#gene_wordcloud');
    wordcloud_view.change('myvalues', vega.changeset().insert(vals)).width(newwidth).height(newheight).renderer('canvas').hover().run();
    jQuery(window).resize(function() {
        wordcloud_view.resize().width(setWidth()).height(newheight).renderer('canvas').hover().run();
    });
}

var get_gene=function(a, browser) {
    var query = window.location.search;
    if (browser.search.gene) {
        browser.search.gene = a;
        browser.search.gene = browser.search.gene.toUpperCase();
        jQuery("#gene").val("");
        jQuery('#gene').blur();
        window.location.replace("#Genepage?gene=" + browser.search.gene);
        jQuery("#Genepage").slideDown();
        jQuery("#About").hide();
        jQuery("#tab1").click();
        mygene = browser.search.gene;
        load_geneInfo(browser);
    }
}

function cincludes(container, value) {
    var returnValue = false;
    var pos = container.indexOf(value);
    if (pos >= 0) {
        returnValue = true;
    }
    return returnValue;
}
var pathname = window.location.pathname;
if (cincludes(pathname, "?location=")) {
    var re = /location=chr(.+?):([0-9]+?)-([0-9]+)/;
    var match = re.exec(str);
    browser.search['chr'] = match[1];
    if (match[2] > 0) {
        browser.search['first_pos'] = match[2];
    } else {
        browser.search['first_pos'] = 0;
    }
    if (match[3] > 300000000) {
        browser.search['first_pos'] = 300000000;
    } else {
        browser.earch['first_pos'] = match[3];
    }
    browser.search['buffer'] = match[2] - match[3];
    browser.search['left'] = match[3] - buffer;
    browser.search['right'] = match[3] - buffer;
    if (browser.search['left'] < 0) {
        browser.search['left'] = 0;
    }
} else if (cincludes(pathname, "?gene=")) {
    var re = /gene=chr(\w+?)/;
    var match = re.exec(str);
    browser.search['gene'] = match[1];
}
jQuery("#gene").on("keypress", function(e) {
    if (e.which == 13) {
        
        get_gene(jQuery("#gene").val(), browser);
        
    }
});

		var load_geneInfo=function(browser) {
    var mygene = browser.search.gene;
    var gene_api_url = browser.global_api + "/gene/" + mygene;
    jQuery.ajax({
        'async': false,
        'headers': headers,
        'url': gene_api_url,
        'dataType': "json",
        'success': function(data) {
            var data = JSON.parse(itgz.decompressFromBase64(decodeURI(data.gene)));
            var Gene_array = reformat_gene_description(data);
            browser['TPMs'] = data.TPMs;
            browser['gtex'] = data.gtex;
            render_gene_wordcloud(Gene_array.wordvalues);
            browser.search['chr'] = Gene_array.chr;
            var temp = Gene_array.last_pos - Gene_array.first_pos;
            browser.search['last_pos'] = Gene_array.last_pos + temp * .1;
            browser.search['first_pos'] = Gene_array.first_pos - temp * .1;
            browser.search['genequery'] = browser.search.gene;
            browser.search['chr'] = browser.search.chr;
            browser.search['first_pos'] = browser.search.first_pos;
            browser.search['last_pos'] = browser.search.last_pos;
            browser['TPMs'] = Gene_array.TPMs;
            browser['bargraph_vgSpec'] = JSON.parse(itgz.decompressFromBase64(decodeURI('')));
            browser['bargraph_vgSpec']['config'] = config_vega();
            //render_vega(vgspec_scatterhist,signals_gvscatterhis,browser['TPMs'],"#view_smartplot");
            render_BarGraph(browser);
            load_datatable(browser);
            browser.region.chr = browser.search['chr'];
            browser.region.first_pos = browser.search['first_pos'];
            browser.region.last_pos = browser.search['last_pos'];
            browser.region.gene = browser.search.gene;
            render_browser_full(browser);
            jQuery("#browser_window").click();
        }
    });
}

